import React from "react";
import { SafeAreaView, View, Text, Image, TouchableOpacity, StyleSheet, ScrollView } from "react-native";
import { COLORS, SIZES, FONTS, icons, images } from "../constants";

const User = ({ navigation }) => {
    // Sample user data
    const user = {
        name: "Juan Dela Cruz",
        profilePic: images.profilePic, // Replace with actual image source
        profileLimits: "Basic",
        linkedAccounts: [
            { type: "Bank Account", value: "**** 1234" },
            { type: "Paypal", value: "example@paypal.com" }
        ],
        qrCodes: "View QR Code",
        nfcTag: "View NFC Tag",
        juanByteScore: "1234",
        isBetaFeature: true
    };

    function renderHeader() {
        return (
            <View style={styles.header}>
                <TouchableOpacity
                    style={styles.iconButton}
                    onPress={() => navigation.goBack()}
                >
                    <Image
                        source={icons.back}
                        style={styles.icon}
                    />
                </TouchableOpacity>

                <View style={styles.titleContainer}>
                    <Text style={styles.title}>Profile</Text>
                </View>

                <TouchableOpacity
                    style={styles.iconButton}
                    onPress={() => console.log("Settings")}
                >
                    <Image
                        source={icons.settings}
                        style={styles.icon}
                    />
                </TouchableOpacity>
            </View>
        );
    }

    function renderProfile() {
        return (
            <View style={styles.profileContainer}>
                <Image source={user.profilePic} style={styles.profilePic} />
                <Text style={styles.userName}>{user.name}</Text>
                <TouchableOpacity style={styles.button} onPress={() => console.log("View Profile")}>
                    <Text style={styles.buttonText}>View Profile</Text>
                </TouchableOpacity>
            </View>
        );
    }

    function renderProfileLimits() {
        return (
            <View style={styles.card}>
                <Text style={styles.cardTitle}>Profile Limits</Text>
                <Text style={styles.cardContent}>{user.profileLimits}</Text>
            </View>
        );
    }

    function renderLinkedAccounts() {
        return (
            <View style={styles.card}>
                <Text style={styles.cardTitle}>Linked Accounts</Text>
                {user.linkedAccounts.map((account, index) => (
                    <Text key={index} style={styles.cardContent}>
                        {account.type}: {account.value}
                    </Text>
                ))}
            </View>
        );
    }

    function renderQrCodes() {
        return (
            <TouchableOpacity style={styles.card} onPress={() => console.log("View QR Code")}>
                <Text style={styles.cardTitle}>My QR Codes</Text>
                <Text style={styles.cardContent}>{user.qrCodes}</Text>
            </TouchableOpacity>
        );
    }

    function renderNfcTag() {
        return (
            <TouchableOpacity style={styles.card} onPress={() => console.log("View NFC Tag")}>
                <Text style={styles.cardTitle}>NFC Tag Linked</Text>
                <Text style={styles.cardContent}>{user.nfcTag}</Text>
            </TouchableOpacity>
        );
    }

    function renderJuanByteScore() {
        return (
            <View style={styles.card}>
                <Text style={styles.cardTitle}>JuanByte Score</Text>
                <Text style={styles.cardContent}>{user.juanByteScore}</Text>
            </View>
        );
    }

    function renderBetaFeatures() {
        return (
            user.isBetaFeature && (
                <View style={styles.card}>
                    <TouchableOpacity style={styles.button} onPress={() => console.log("Verify Account")}>
                        <Text style={styles.buttonText}>Verify Account (Beta)</Text>
                    </TouchableOpacity>
                </View>
            )
        );
    }

    return (
        <SafeAreaView style={styles.container}>
            <ScrollView
                contentContainerStyle={styles.scrollContainer}
                stickyHeaderIndices={[0]} // Ensure the header sticks to the top
            >
                {renderHeader()}
                {renderProfile()}
                {renderProfileLimits()}
                {renderLinkedAccounts()}
                {renderQrCodes()}
                {renderNfcTag()}
                {renderJuanByteScore()}
                {renderBetaFeatures()}
            </ScrollView>
        </SafeAreaView>
    );
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: COLORS.white,
    },
    header: {
        flexDirection: 'row',
        marginVertical: SIZES.padding * 4,
        paddingHorizontal: SIZES.padding * 3,
        alignItems: 'center',
        backgroundColor: COLORS.white, // Ensure background color to cover content below
        elevation: 4, // Shadow for Android to give a raised effect
    },
    iconButton: {
        width: 45,
        alignItems: 'center',
        justifyContent: 'center',
    },
    icon: {
        height: 20,
        width: 20,
        tintColor: COLORS.black,
    },
    titleContainer: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    },
    title: {
        color: COLORS.black,
        ...FONTS.h3,
    },
    profileContainer: {
        alignItems: 'center',
        marginVertical: SIZES.padding * 2,
    },
    profilePic: {
        width: 100,
        height: 100,
        borderRadius: 50,
        borderWidth: 2,
        borderColor: COLORS.primary,
        marginBottom: SIZES.base,
    },
    userName: {
        ...FONTS.h2,
        color: COLORS.black,
        marginBottom: SIZES.base,
    },
    button: {
        backgroundColor: COLORS.primary,
        paddingVertical: SIZES.base,
        paddingHorizontal: SIZES.padding * 2,
        borderRadius: 10,
        alignItems: 'center',
    },
    buttonText: {
        color: COLORS.white,
        ...FONTS.h4,
    },
    card: {
        backgroundColor: COLORS.lightGray,
        marginVertical: SIZES.base,
        padding: SIZES.padding,
        borderRadius: 10,
        shadowColor: "#000",
        shadowOffset: { width: 0, height: 3 },
        shadowOpacity: 0.27,
        shadowRadius: 4.65,
        elevation: 6,
    },
    cardTitle: {
        ...FONTS.h4,
        color: COLORS.black,
        marginBottom: SIZES.base,
    },
    cardContent: {
        ...FONTS.body4,
        color: COLORS.gray,
    },
    scrollContainer: {
        paddingHorizontal: SIZES.padding * 3,
        paddingBottom: SIZES.padding * 5,
    },
});

export default User;
